import React from 'react';
import '../../styles/CategoriasAdmin.css';
import Arrowdown from '../../images/flechaabajo.png'


class CategoriasAdmin extends React.Component {
    render() {
        return (
            <div className="card">
                <ul className="list-group list-group-flush">
                    <li classname="list-group-item" id="Categorias">

                        <p className="d-inline-block " id="Admin_texto"><a href={this.props.linkmusica}>{this.props.nombrecancion}</a></p>
                        <img src={Arrowdown} id="Imagen_Categoria" alt="" />
                    </li>
                </ul>
            </div>

        )
    }
}
export default CategoriasAdmin;
